            BeginWriteAttribute("alt", " alt=\"", 1863, "\"", 1869, 0);
            EndWriteAttribute();
            WriteLiteral(@">

            <p>
                <strong>Kulak Burun Boğaz</strong><br>
            </p>

            <p>
                Kulak Burun Boğaz Bölümümüzde; kulak, burun, boğaz ve ilgili baş boyun hastalıklarının teşhis ve tedavisini gerçekleştirmekteyiz.<br>
                <br>
                Gelişmiş teknolojiye dayalı tanı ve tedavi yöntemlerinin kullanıldığı bölümümüzde; endoskopik ve mikroskobik işlemler ile duyma ve denge sistemi&nbsp;hastalıklarının muayene, tetkik ve tedavisini yapılmaktadır. Kulak Burun Boğaz ameliyatları ve baş boyun tümörlerine yönelik onkolojik cerrahi operasyonlar da başarıyla uygulanmaktadır.<br>
                <br>
                Hastalarımızın; acil, poliklinik ve yatarak tedavileri deneyimli uzman kadromuz ile güncel teşhis ve tedavi yöntemleri kullanarak en etkin şekilde gerçekleştirilmektedir.<br>
                <br>
                <strong>Kulak Burun Boğaz Bölümümüzün hizmet alanına giren hastalıklar;</strong><br>
                <br>
                <st");
            WriteLiteral(@"rong>Kulak Hastalıkları</strong><br>
                &nbsp; *&nbsp;&nbsp; Kulak Hastalıkları ve İşitme Bozuklukları<br>
                &nbsp; *&nbsp;&nbsp; Kulak enfeksiyonları<br>
                &nbsp; *&nbsp;&nbsp; İşitme kayıpları<br>
                &nbsp; *&nbsp;&nbsp; Denge hastalıkları<br>
                &nbsp; *&nbsp;&nbsp; Baş dönmesi<br>
                &nbsp; *&nbsp;&nbsp; Çınlama<br>
                <br>
                <strong>Burun Hastalıkları</strong><br>
                &nbsp; *&nbsp;&nbsp; Kronik sinüzit<br>
                &nbsp; *&nbsp;&nbsp; Burun alerjileri<br>
                &nbsp; *&nbsp;&nbsp; Koku alma bozuklukları<br>
                &nbsp; *&nbsp;&nbsp; Burun kanamaları<br>
                &nbsp; *&nbsp;&nbsp; Burun tıkanıklığı ve burnun dış görünümü ile ilgili problemler<br>
                &nbsp; *&nbsp;&nbsp; Burun polipleri<br>
                &nbsp; *&nbsp;&nbsp; Gözyaşı bezi tıkanıklıkları gibi hastalıkları<br>
                <br>
                <strong");
            WriteLiteral(@">Boğaz Hastalıkları</strong><br>
                &nbsp; *&nbsp;&nbsp; Geniz eti ve bademcikle ilgili problemler (sık enfeksiyon ve aşırı büyüklük, vb.)<br>
                &nbsp; *&nbsp;&nbsp; Horlamaya ve uykuda nefes durmasına sebep olan yumuşak damak ve küçük dildeki sarkmalar<br>
                &nbsp; *&nbsp;&nbsp; Ses teli hastalıkları (enfeksiyon, polip, nodül, vb.)<br>
                &nbsp; *&nbsp;&nbsp; Larengofarengeal reflü (mide asidinin yukarı kaçması nedeniyle boğaz yapılarında oluşturduğu&nbsp; bozukluklar)<br>
                &nbsp; *&nbsp;&nbsp; Dudak, dil ve ağız içerisindeki kitleler<br>
